      redirect: false
    };
  }

  componentWillMount() {
    if (sessionStorage.getItem("data")) {
    } else {
      this.setState({ redirect: true });
    }
  }

  render() {
    if (this.state.redirect) {
      return <Redirect to="/admin/login" />;
